import React from 'react';
import './main.css';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-brand">Bloom & Grow</div>
      <div className="navbar-links">
        <Link to="/dashboard">Dashboard</Link>
      </div>
      <h1>GROW IMPRESS</h1>
        <p>Your personal growth journey starts here. Learn, grow, and impress.</p>
    </nav>
  );
};

export default Navbar;
